import React, { useState } from 'react';
import '../styles/SurveyPage.css';

interface SurveyAnswers {
  activity: string | null;
  style: string | null;
}

const SurveyPage: React.FC = () => {
  const [answers, setAnswers] = useState<SurveyAnswers>({
    activity: null,
    style: null,
  });

  const [submitted, setSubmitted] = useState(false);

  const handleActivityClick = (activity: string) => {
    setAnswers((prev) => ({ ...prev, activity }));
  };

  const handleStyleClick = (style: string) => {
    setAnswers((prev) => ({ ...prev, style }));
  };

  const handleSubmit = () => {
    if (answers.activity && answers.style) {
      setSubmitted(true);
      console.log('User answers:', answers);
    } else {
      alert('Please answer both questions!');
    }
  };

  return (
    <div className="survey-container">
      {!submitted ? (
        <>
          <h1>Tell us about yourself!</h1>

          <div className="question">
            <h3>What do you like to do?</h3>
            <div className="options">
              <button onClick={() => handleActivityClick('Party')}>Party</button>
              <button onClick={() => handleActivityClick('Chill')}>Chill</button>
              <button onClick={() => handleActivityClick('Workout')}>Workout</button>
              <button onClick={() => handleActivityClick('Road Trip')}>Road Trip</button>
            </div>
          </div>

          <div className="question">
            <h3>What is your style?</h3>
            <div className="options">
              <button onClick={() => handleStyleClick('Trendy')}>Trendy</button>
              <button onClick={() => handleStyleClick('Casual')}>Casual</button>
              <button onClick={() => handleStyleClick('Sporty')}>Sporty</button>
              <button onClick={() => handleStyleClick('Vintage')}>Vintage</button>
            </div>
          </div>

          <button className="submit-button" onClick={handleSubmit}>
            Submit
          </button>
        </>
      ) : (
        <div className="result">
          <h2>Thanks for submitting!</h2>
          <p>Activity: {answers.activity}</p>
          <p>Style: {answers.style}</p>
        </div>
      )}
    </div>
  );
};

export default SurveyPage;
